import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route, 
  Link
} from 'react-router-dom'
import {InfoPanel} from './layout/infoPanel.layout'
import Home from './components/Home'
import Login from './components/login'
import {PageVendedor} from './components/Vendedor/PageVendedor'
import './App.css';

import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <Router>
    <div className="App">
      <Routes>
        <Route exact path ="/" element={<Login/>} />
        <Route exact path="/home" element={<Home/>} />
        <Route exact path="/Respuestas" element={<InfoPanel/>} />
        <Route exact path="/Vendedor" element={<Vendedor/>} />
        <Route exact path="/contacto" element={<h1>pagina de contacto</h1>}/>
      </Routes>
    </div>
    </Router> 
  );
}

export default App;
